message:
JESUS, O GRANDE "EU SOU"
Em Êxodo 3.14 Deus se revelou como o "Eu sou o que sou". Deus é autoexistente e eterno. Jesus, o Deus que se fez carne, a expressão exata do ser de Deus, em quem habita corporalmente toda a plenitude da divindade, se apresentou no evangelho de João, identificando-se como o EU SOU O QUE SOU. 

1) Eu sou o Pão da Vida; 
2) Eu sou a Luz do mundo;
3) Eu sou a Porta das ovelhas; 
4) Eu sou o bom Pastor; 
5) Eu sou a Ressurreição e a Vida; 
6) Eu sou o Caminho, e a Verdade, e a Vida; 
7) Eu sou a Videira verdadeira.

⚘🍃🌹 ━━━━━━━━━━━━━━━━━━━━⚘🍃🌹 🍃🌹.                                                         *Bom dia ☀️ * A expressão “buscai primeiro o Reino de Deus” significa que a vontade de Deus deve estar em primeiro lugar em nossas vidas. Quando buscamos o Reino de Deus acima de tudo, Deus cuida de nossas outras necessidades. Nada é mais importante que o Reino de Deus. Jesus disse que devemos buscar “o Reino de Deus e a sua justiça”. Tudo o resto depois seria acrescentado. Não precisamos ficar preocupados com outras coisas porque Deus está no controle e cuida de nós. Portanto, colocai o Reino de Deus em primeiro lugar e no mais Ele fará por você! .
